INSERT INTO `chugim` VALUES ("Soccer",1,18,6,"Learn the basic skills and techniques of soccer and the importance of teamwork. We will challenge more experienced players with higher-level drills.",2,"Sport","John"),("Cooking",2,20,3,"Campers will explore cooking with an emphasis on Jewish food and its history and good nutrition. Campers will learn how to make specific dishes as well as build the skills that will enable them to read and follow recipes.",3,"Bishul","Jacob"),("Teva",2,18,4,"Campers in this chug will become the stewards of the Ramah Garden and will learn about and tend to all of the plants growing at camp.",4,"Teva","Fred"),("Weaving, Sewing &amp; Needle-Point",2,10,3,"Get your needle and thread ready to learn to sew! Campers will also use yarn and needlepoint plastic canvases to create patterns and designs.",5,"Art","Jonas"),("Softball",4,16,7,"Campers will learn the basic skills and techniques of softball! Weâ€™ll work to improve offensive and defensive skills, and weâ€™ll focus on the importance of teamwork on and off the field. More advanced players will be offered high-level drills and coaching. Throughout, we will have a lot of fun playing and enjoying Americaâ€™s pastime!",6,"Sport","Frank"),("Ultimate Frisbee",1,16,6,"In this chug, campers will learn the rules, skills and strategies of the game. Because of the free-flowing nature of the sport, every player has the opportunity to be a thrower, receiver and defender in every game.",7,"Sport","Brandon"),("Dance",2,15,4,"Hip-hop, modern dance, or classic Israeli folk dance â€” whatever your preference, this is the chug for you! Come sharpen your technique and learn new choreography.",8,"Rikud","Brian"),("Flag Football",3,16,4,"Campers who participate in this chug will learn the basic skills of football, from how to throw a spiral and catch properly to running routes and playing defense. Once past the basics we will learn more advanced aspects of the game, such as offensive and defensive schemes. All 