es we\'ve grown in the garden to create! We will pickle vegetables, make tea, and create flower art arrangements.",188,"Teva","Gabi"),("Judaic Crafts",2,18,5,"Weave challah baskets and design and create hamsa wall hangings.  Each project will take a couple days to complete.",189,"Art","Miri"),("Judaic Crafts",4,18,5,"Weave challah baskets and design and create hamsa wall hangings.  Each project will take a couple days to complete.",190,"Art","Jonathan"),("Challah Days",3,18,5,"Design and create your own wooden challah board.  This is a week long project.",191,"Art","Lala"),("Challah Days",4,18,4,"Design and create your own wooden challah board.  This is a week long project.",192,"Israel","Aliza"),("Israeli Mosaics",3,18,4,"Using colorful mosaic tiles, campers will design candle holders, trivets, and other creations.",193,"Israel","Avi"),("Bishul Ba-Hutz (Outdoor Cooking)",2,12,3,"Learn resourcefulness and responsibility at the medurah (campfire) with this fun and practical outdoor cooking chug. (Some days, Bishul &amp; Bishul Ba\'Hutz - Indoor &amp; Outdoor Cooking - will be combined.)",194,"Bishul","Dina"),("Bishul/Cooking",4,22,4,"Kids will have fun in the kitchen exploring new recipes and developing hands-on cooking skills. (Some days, Bishul &amp; Bishul Ba\'Hutz - Indoor &amp; Outdoor Cooking - will be combined.)",195,"Bishul","Lulu"),("Tel Aviv Dance Party",3,16,5,"Get down and boogy Tel Aviv style! Learn modern dance with popular Israeli songs and have fun with our Shlicha Nofar.  (Think Jungle, Unicorn, and Tudo Bom)",196,"Rikud","Noah"),("Shira with Hana (Song and Percussion)",1,16,5,"We will learn vocal exercises, how to harmonize, and the basics of beat and rhythm using our bodies as instruments.",197,"Shira","Jack"),("Teva Mashup",3,18,5,"This session we will get our hands dirty tending the Ramah garden while learning about plants and their place in our ecosystem.",198,"Teva","Franklin"),("Board Games and Brain Games",2,16,5,"Learn strategy and decision 