ole, and more!",210,"Sport","Sam"),("Handasah (Engineering &amp; Makerspace)",1,18,4,"With a little imagination, some simple tools, and engineering principles, a corrugated/cardboard box can become just about anything you want it to be. Whether young or all grown up, making things out of cardboard requires us to imagine, plan, build, adjust and improve our creation. (Campers will be using only age-appropriate tools in this chug.)",211,"Art","Zachary"),("The Art of Animation",3,16,4,"Spend the week exploring cartoons and animation, including comic strips and flipbooks.",212,"Art","Ethan"),("The Art of Animation",2,16,4,"Spend the week exploring cartoons and animation, including comic strips and flipbooks.",213,"Art","Gabe"),("Puppet Making",1,18,4,"We will create a variety of puppets such as sock puppets and finger puppets, and hopefully have time to showcase them in a puppet show.",214,"Drama","Margo"),("Puppet Making",4,18,4,"We will create a variety of puppets such as sock puppets and finger puppets, and hopefully have time to showcase them in a puppet show.",215,"Drama","Phoebe"),("Give My Regards to Broadway (Omanut/Art)",2,18,4,"Spend the week learning about costumes on Broadway and create some examples!",216,"Drama","Anna"),("Give My Regards to Broadway (Omanut/Art)",3,18,4,"Spend the week learning about costumes on Broadway and create some examples!",217,"Drama","Lilah"),("Favorite Camp Games",1,18,4,"Enjoy downtime, indoor games such as sharks &amp; minnows, ghosts in the graveyard, mafia, and more!",218,"Games","Alex"),("Dino Days of Summer",1,18,4,"Explore dinosaurs with clay, drawing and building!",219,"Science","Lisa"),("Dino Days of Summer",3,18,4,"Explore dinosaurs with clay, drawing and building!",220,"Science","Katie"),("Zimkudiyah Costume Design &amp; Stage Prep (Omanut",1,18,4,"Join us in Omanut (arts &amp; crafts) as we prepare for Zimkudiyah (our song &amp; dance festival) by helping with set design, costumes &amp; signage.",221,"Art","Zoey"),("Zimkudiyah Costume Design &amp; Stage Prep (Omanut",4,18,4,"Join us in Omanut (arts &amp; crafts) as we prepare for Zimkudiyah (our song &amp; dance festival) by helping with set design, costumes &amp; signage.",222,"Art","Zachary"),("Card Creations (Greeting Cards)",4,18,4,"Using various methods of drawing, printing, collage and paper marbling, campers will create and take home 10-12 greeting cards to send to family &amp; friends.",223,"Art","Sean"),("Choice Week in Omanut",1,18,4,"Choose from several favorite art media to use during the week. (Each camper must finish one project before moving on to another.)",224,"Art","Kayla"),("Choice Week in Omanut",2,18,4,"Choose from several favorite art media to use during the week. (Each camper must finish one project before moving on to another.)",225,"Art","Xander"),("Choice Week in Omanut",4,18,4,"Choose from several favorite art media to use during the week. (Each camper must finish one project before moving on to another.)",226,"Art","Annie"),("Choice Week in Omanut",3,18,4,"Choose from several favorite art media to use during the week. (Each camper must finish one project before moving on to another.)",227,"Art","Andrea"),("Camp &amp; Israeli Games",3,18,4,"Play favorite Israeli games and movement activities with our terrific madrichim &amp; shlichim.",228,"Israel","David Offit");
